        }
      }
      else // <
      {
        if (value1 < value2) {
          pass = true;
        }
        else
        {
          pass = false;
        }
      }

      if (!pass) {
        break;
      }

      var1 = var2;
      rank1 = rank2;
    }

    if (!pass) {
      break;
    }
  }

  if (pass) {
